import MyNavbar from "./components/Navbar/Navbar";
function Setting(){
    
      return (
        <>
        {isLogin('admin')?(
        <div>
           <MyNavbar />
          <h1>Panel page</h1>
        </div>
       
        ):
        (  
          <Navigate to={'/'}/>
        )}
        </>
      )
}
export default Setting
